import UserForm from '../Form';
import { Container } from './ModalElements';

const Modal = ({ setOpenModal }) => {
	return (
		<Container>
			<TitleCloseBtn>
				<button
					onClick={() => {
						setModalOpen(false);
					}}
				>
					X
				</button>
			</TitleCloseBtn>
			<UserForm setOpenModal={setOpenModal} />
		</Container>
	);
};

export default Modal;
